import React, {Component} from "react";

export default class Counter extends Component{
    constructor(props){
        super(props)
        this.state= {
            count: 0
        }
    }
     getCount() {
        this.setState({
            count : this.state.count + 1
        })
    }

    render(){
        return(
            <div>
            <h3>count- {this.state.count}</h3>
            <button onClick={getCount}>Click</button>

            </div>
            
        );
    }

}
